            <ul>
                <li>
                    {title}
                </li>
                {/* <QuestionItem visibility={visibility} questions={questions} /> */}
            </ul>
            <img src="img_girl.jpg" width="500" height="600" />
        </div>
    )
}

export default QuestionCard
